import React, { Component } from "react";
import logo from "./logo.svg";
import "./App.css";

import Navigation from "./components/navigation";

function App() {
  return (
    <div className="App">
      navigation
      <img src={logo} className="App-logo" alt="logo" />
    </div>
  );
}

export default App;
